import earth from "../img/earth.png";

const Reach = () => {
  

  return (
    <>
      <section id="reach">
        <div className="ceo"></div>

        <div className="earth">
          <picture>
            <p className="txt" onLoad={() => rotateText()}>
              REACHING. CONVERSION. RELATION.
            </p>
            <img src={earth} alt="Earth" style={{ transform: "scale(1.01)" }} />
          </picture>
        </div>
      </section>
    </>
  );
}

export default Reach;
